@1:30:00 what it means its zen like , tai chi , a warrior within the garden. Be happy ,bask in it, feel it, but not get overwhelmed too much, and neither too low. 

Like all things, perfectly balanced

The every day zen, from Suzuki …. Or some of the earnest living religious people. Interestingly how combatants and monks have in common.

I felt the holy spirit ministering to me the whole way through this video, SOOOO much I already intrinsically knew but let myself lose sight of because of self-doubt and victim mentality. Some of this stuff can be hard to hear, and that is OK...hard truths are hard truths for a reason, not a single one of us goes through life without having to grapple with hard to swallow pills. I DO think we can be special without it meaning we can absolve ourselves from responsibility for our own shit....just like in your moments of accomplishments, be grounded or 'neutral'. Same with whatever makes you special. We are all the same while simultaneously all unique. Celebrate accomplishments, but don't be so into the celebration that it all becomes your identity. A lot of elements of 'balance' in this conversation. Great interviewer, great guest, I LOVE her mind and the wisdom she poured out all over this episode. My prayers are being answered left and right, the timing that this video showed up in my feed during is nothing short of miraculous, and I really needed to see this. Yes God, I am on my way now, finally. I accept my identity in you and all the blessings to come on my new fresh start in life, thank you Father, Amen!!!

@TheDiaryOfACEO this upload just helped save a life. I am in tears in the best possible way. I can't explain it as anything but a miracle, you have no idea how impactful this was to me. Thanks for doing this interview with this guest....I'm just in so much awe....wish I could explain why I'm so excited about this, but it would take writing a novel. All I can say is God is making moves and you just fulfilled a role he has had planned for you. Amazing seeing it happen. 

I feel like I've been set free, I'm so happy. :)

@41:14 there is ALWAYS a reward. Humans are pretty basic. We will always do what we perceive to have more benefit than drawbacks.
Some benefits of being down might be support, a reason to logically justify failure, fear of failure (it’s safer to do nothing), certainty (we’re wired for it). No one wants to be there - but it’s perceived to be better than the alternative, and yes - it becomes a habit. The longer you’re stuck there - the harder it’s gonna be to get out.

There’s probably many more justifications for it but that’s just my personal reflection
